import profilepic from "../src/img/shruti.jpeg"
import profilepic1 from "../src/img/shruti.jpeg"
import profilepic2 from "../src/img/shruti.jpeg"
import profilepic3 from "../src/img/shruti.jpeg"
import profilepic4 from "../src/img/shruti.jpeg"
const Sdata = [
    {
        imgsrc: profilepic,
        title: "img1",
    },
    {
        imgsrc: profilepic1,
        title: "img2",
    },
    {
        imgsrc: profilepic2,
        title: "img2",
    },
    {
        imgsrc: profilepic3,
        title: "img3",
    },
    {
        imgsrc: profilepic4,
        title: "img4",
    },
    {
        imgsrc: profilepic4,
        title: "img4",
    }
]
export default Sdata;
